import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Contact() {
  const [buildings, setBuildings] = useState([]);

  useEffect(() => {
    // Fetch building data from the API with credentials using Axios
    axios.get('http://localhost:4000/zgrade', {
      withCredentials: true,  // This sends cookies along with the request (if applicable)
    })
    .then((response) => {
      console.log('Fetched data:', response.data); // Log the data to see its structure
      setBuildings(response.data);  // Assuming response.data is the array of buildings
    })
    .catch((error) => {
      console.error('Error fetching buildings:', error);
    });
  }, []);

  return (
    <div>
      <h1>Buildings</h1>
      <div className="building-list">
        {Array.isArray(buildings) && buildings.length > 0 ? (
          buildings.map((building) => (
            <div key={building.id} className="building-item">
              <h2>{building.name}</h2>
              <img src={building.image_url} alt={building.name} width="300" />
            </div>
          ))
        ) : (
          <p>No buildings available</p>
        )}
      </div>
    </div>
  );
}

export default Contact;
